import { useState } from "react";
const Home = () => {
  const [blogs, setBlogs] = useState([
    {
      title: "my new Website",
      body: "lorem ipsum....",
      author: "khairi",
      id: 1,
    },
    {
      title: "my new Website",
      body: "lorem ipsum....",
      author: "fayed",
      id: 2,
    },
    {
      title: "my new Website",
      body: "lorem ipsum....",
      author: "othman",
      id: 3,
    },
  ]);
  return (
    <div className="home">
      {blogs.map((blog) => (
        <div className="blog-preview" key={blog.id}></div>
      ))}
    </div>
  );
};

export default Home;
